export default function Interests() {
  return (
    <div className="Interests">
      <h2>Interests</h2>
      <p>
        Artist. Musician. Reader. Internet fanatic. Donut buff. Travel geek. Pop
        culture ninja. Coffee fanatic.
      </p>
    </div>
  );
}
